import React, { FC } from 'react'
import styles from './button.module.css'

type ClickType = {
  onClickHandler?: () => void
}

export const Button: FC<ClickType> = ({ onClickHandler }) => {
  return (
    <>
      <button
        type="submit"
        className={styles.buttonTweet}
        onClick={() => {
          if (onClickHandler) {
            onClickHandler()
          }
        }}
      >
        Tweet
      </button>
    </>
  )
}

export default Button
